import React from "react";
import {
  Wrapper,
  LogoBrandWrapper,
  FindWrapper,
  LogoWrapper,
} from "./catalog.styled";
import { LaptopOutlined, SearchOutlined } from "@ant-design/icons";
import { TextInput } from "react-native-web";
import CardItem from "../../components/cardItem";

const Catalog = () => {
  <Wrapper>
    <div>
      <LogoBrandWrapper>
        <LogoWrapper>
          <LaptopOutlined style={{ width: 50, color: "#CE4E45" }} />
        </LogoWrapper>
        <p>Lap-Top</p>
      </LogoBrandWrapper>
    </div>
    <FindWrapper>
      <TextInput
        style={{
          backgroundColor: "white",
          border: "1.2px solid #ffffff",
          borderRadius: "7px",
          width: "400px",
          height: "40px",
        }}
        placeholder="Введіть модель"
        placeholderTextColor="grey"
      />

      <LogoWrapper>
        <SearchOutlined style={{ width: 50 }} />
      </LogoWrapper>
    </FindWrapper>

    <CardWrapper>
      {data.map(({ title, text, image, price }, idx) => (
        <CardItem
          title={title}
          text={text}
          imageSrc={image}
          price={price}
          id={idx}
        />
      ))}
    </CardWrapper>
  </Wrapper>;
};

export default Catalog;
